function renderParams(layers, zoom) {
    var lOpts = layers.split("/");
    layers = lOpts[0];
    var stretch = lOpts[1];
    var paramsRaw = layers.split(/[,;]/);
    if (!paramsRaw.length) {
        return ''
    }
    if (paramsRaw[0].substr(0, 1) === 's') {
        var stickerId = parseInt(paramsRaw.shift().substr(1))
    }
    var setColors = {
        eyes: '#462B11',
        head: '#F9DDC4',
        hair: '#3B3128',
        mouth: '#F5919F',
        beard: '#3B3128',
        accessories: '#A5A5A5',
    }
    var isWoman = 0;

    var width = 640.6;
    var height = 841.9;

    function genTParams(st, old) {
        if (!st && old) return old
        return {
            x: (old ? old.x : 0) + st[0] / 400 * height,
            y: (old ? old.y : 0) + st[1] / 400 * height,
            r: (old ? old.r : 0) + (st[2] || 0),
            sx: st[3] ? (st[3] / 100) : 1.0,
            sy: st[3] ? (st[3] / 100) : 1.0,
        };
    }

    function getTransform(par) {
        var t = '';
        if (par.x || par.y) {
            t += 'translate(' + par.x + ' ' + par.y + ') '
        }
        if (par.r) {
            t += 'rotate(' + par.r + ' ' + (width / 2) + ' ' + (height / 2) + ') ';
        }
        if (par.sx !== 1.0 || par.sy !== 1.0) {
            t += 'scale(' + par.sx + ' ' + par.sy + ') ';
        }
        if (t) {
            return 'transform=\"' + t + '\"';
        } else {
            return '';
        }
    }

    var colors = {}
    for (var colorType in Config.colors) {
        for (var k in Config.colors[colorType]) {
            var color = Config.colors[colorType][k]
            color.type = colorType
            colors[color.id] = color
        }
    }

    var i, layerId;
    for (i in paramsRaw) {
        layerId = paramsRaw[i];
        if (layerId === 0) {
            isWoman = 1
        }

        if (colors[layerId]) {
            setColors[colors[layerId].type] = '#' + colors[layerId].hash
        }
    }
    var params = [];

    for (i in paramsRaw) {
        if (paramsRaw[i]) {
            params.push(parseInt(paramsRaw[i]))
        }
    }
    if (!stickerId && params.length > 9 && params.indexOf(160) === -1) {
        params.push(159)
        params.push(160)
    }

    var out = '';

    var layersCut = {};
    if (stickerId) {
        var sticker = Config.stickers[stickerId];
        if (Config.stickers[stickerId]) {
            for (i in Config.stickers[stickerId].sections) {
                var cutRows = Config.layers[Config.stickers[stickerId].sections[i]];
                if (!cutRows) {
                    continue
                }
                for (var k in cutRows) {
                    layersCut[parseInt(cutRows[k])] = true
                }
            }
        }
    }

    if (stretch) {
        stretch = stretch.split(':');
        for (i in stretch) {
            stretch[i] = parseFloat(stretch[i]);
        }
    }

    var wraps = {head: '', tail: '', clipPath: ''};
    for (k in Config.svg) {
        var layerName = Config.svg[k][0] + '';
        var layerBody = Config.svg[k][1];
        var layerTag = Config.svg[k][2];

        if (!layerName) {
            continue
        }

        if (layerName === 'head' || layerName === 'tail') {
            wraps[layerName] = layerBody;
            continue;
        }

        var isSticker = false;
        var layerMatch = layerName.match(/^(s?)([wm]?)([0-9]+)$/);
        if (!layerMatch) {
            continue
        }
        layerId = parseInt(layerMatch[3]);
        var layerSex = layerMatch[2];
        if (!isWoman && layerSex === 'w') {
            continue;
        }
        if (isWoman && layerSex === 'm') {
            continue;
        }
        if (layerMatch[1]) {
            isSticker = true
        }
        if (isSticker) {
            if (stickerId !== layerId || !stickerId) {
                continue
            }
        } else if (!layerId || params.indexOf(layerId) === -1) {
            continue
        } else if (stickerId && layersCut[layerId]) {
            continue
        }
        if (layerTag === 'head') {
            var firstPath = layerBody.match(/<p[^>]+>/);
            if (firstPath) {
                wraps.clipPath = '<defs><clipPath id="face_clip">' + firstPath[0] + '</clipPath></defs>'
            }
        }
        if (layerTag === 'bristle') {
            layerBody = layerBody.replace(/<g /, '<g clip-path="url(#face_clip)" ')
        }

        var par = {x: 0, y: 0, r: 0, sx: 1.0, sy: 1.0};
        if (stretch) {
            switch (layerTag) {
                case 'head':
                    par.y = height * 0.61 * (1 - stretch[0]);
                    par.sy = stretch[0];
                    break;
                case 'hair':
                case 'downhair':
                case 'ears':
                    par.y = height * 0.61 * (1 - stretch[0]);
                    break;
                case 'eyebrows':
                    par.y = height * 0.55 * (1 - stretch[0]);
                    break;
                case 'pupils':
                case 'eyeballs':
                case 'eyes':
                case 'mimic':
                case 'glasses':
                    par.y = height * 0.37 * (1 - stretch[0]);
                    break;
                case 'nose':
                    par.y = height * 0.25 * (1 - stretch[0]);
                    break;
                case 'mouth':
                    par.y = height * 0.10 * (1 - stretch[0]);
                    break;
            }
        }
        if (stickerId && sticker) {
            if (sticker["left_eyebrown"] && layerTag === "eyebrows") {
                layerBody = layerBody.replace(/<g id=\"(l_[^"]+)\"/, '<g id=\"l_' + layerName + '\" ' + getTransform(genTParams(sticker["left_eyebrown"])))
            }
            if (sticker["right_eyebrown"] && layerTag === "eyebrows") {
                layerBody = layerBody.replace(/<g id=\"(r_[^"]+)\"/, '<g id=\"r_' + layerName + '\" ' + getTransform(genTParams(sticker["right_eyebrown"])))
            }
            if (sticker["nose"] && layerTag === "nose") {
                par = genTParams(sticker["nose"], par);
            }
            //if (sticker["all"]) {
            //    par = genTParams(sticker["all"], par);
            //}
            if (sticker["remove_glasses"] && layerTag === "glasses") {
                continue;
            }
        }
        var transform = getTransform(par);
        if (transform) {
            layerBody = layerBody.replace('<g id=\"' + layerName + '\">', '<g id=\"' + layerName + '\" ' + transform + '>')
        }

        out += layerBody
    }

    //var par = (zoom && !stickerId) ? {x:-65, y:0, r:0, sx: 1.2, sy: 1.2} : {x:0, y:0, r:0, sx: 1.0, sy: 1.0};
    if (stickerId && sticker && sticker["all"]) {
        var par = (zoom && !stickerId) ? {x: -65, y: 0, r: 0, sx: 1.2, sy: 1.2} : {x: 0, y: 0, r: 0, sx: 1.0, sy: 1.0};
        out = wraps.head + "<g " + getTransform(genTParams(sticker["all"], par)) + " >" + wraps.clipPath + out + "</g>" + wraps.tail;
    } else {
        var par = {x: -65, y: 0, r: 0, sx: 1.2, sy: 1.2};
        out = wraps.head + "<g " + getTransform(par) + " >" + wraps.clipPath + out + "</g>" + wraps.tail;
    }

    out = out.replace(/#462B11/g, setColors.eyes).replace(/#F9DDC4/g, setColors.head).replace(/#44382E/g, setColors.hair).replace(/#3B3128/g, setColors.hair).replace(/#F5919F/g, setColors.mouth).replace(/#A5A5A5/g, setColors.accessories);

    return out
}